@import "tailwindcss";

/* Make slick arrows visible */
.slick-prev,
.slick-next {
  z-index: 10;
  background-color: rgba(0, 0, 0, 0.4); /* semi-transparent black */
  width: 40px;
  height: 40px;
  border-radius: 9999px;
}

.slick-prev:before,
.slick-next:before {
  color: white;
  font-size: 20px;
}
body {
  @apply font-sans bg-white text-text;
}
